import React from "react";

function Footer() {
  return (
    <div>
      <div className="row" style={{ height: "50px", display: "flex" }}>
        <div className="col-1"></div>
        <div
          className="mt-2 col-3 fa-xl"
          style={{ height: "1px", display: "flex" }}
        >
          <i class="fa-solid fa-house"></i>
        </div>
        <div className="mt-2 col-3">
          <i class="fa-solid fa-scroll fa-xl"></i>
        </div>
        <div className="mt-2 col-3">
          <i class="fa-solid fa-chart-column fa-xl"></i>
        </div>
        <div className="mt-2 col-3">
          <i class="fa-solid fa-gear fa-xl"></i>
        </div>
      </div>
    </div>
  );
}

export default Footer;
